import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => (
  <nav>
    <Link to="/">Home</Link>
    <Link to="/favorites" style={{ marginLeft: "1rem" }}>Favorites</Link>
  </nav>
);

export default Navbar;
